import React, { Component } from "react";
import BookTicketComponent from "./BookTicket.component";
class BookTicket extends Component {
  constructor(props) {
    super(props);
    this.state = {
      currentMovieDetails: props.currentMovieDetails
    };
  }
  componentDidMount() {
    document.addEventListener("eventdetails", e => {
      console.log("booking");

      console.log(e.detail);
    });
  }
  render() {
    return (
      <BookTicketComponent movieDetails={this.state.currentMovieDetails} />
    );
  }
}
BookTicket.defaultProps = {};
export default BookTicket;
